import React from "react";
import "./styles.css";

import CustomLink from "../../customLink/customLink";

const Card = ({ brand, model, cost, imageUrl, color }) => {
  return (
    <CustomLink to={"/sneakers/sneaker"} className="card-container">
      <div className="card-head">
        <h1>{brand}</h1>
        <p>{cost}$</p>
      </div>
      <div className="card-img">
        <img className="main-img" src={imageUrl} />
        <img
          className="alt-img"
          src="https://static.supersklep.cz/1298344-boty-vans-old-skool-love-me-love-me-not-daisy-true-white.jpg?w=1920"
        />
      </div>
      <div className="card-foot">
        <h1>{model}</h1>
        <p>{color}</p>
      </div>
    </CustomLink>
  );
};

export default Card;
